import { css } from '@emotion/core';

export const sidebarContainerStyle = css`
  margin: 1rem;
  min-width: 300px;
  width: 300px;
`;

export const fakeRadioGroupStyle = css`
  opacity: 0;
  height: 1;
  position: absolute;
`;

export const fileUpload = css`
  display: none;
`;
